import React from 'react';
import CustomInput from './../Input/CustomInput';
import CustomButton from './../Button/CustomButton';

const PostForm = (props) => {
	return (
		<form>
			<CustomInput
				type="text"
				placeholder="Title"
				value={props.post.title}
			/>
			<CustomInput
				type="text"
				placeholder="Body"
				value={props.post.body}
			/>
			<CustomButton/>
		</form>
	);
}

export default PostForm;
